function Navbar(){
    return(
        <nav>
            <div className="nav-inner">
                <span className="logo">
                    Logo
                </span>
                <div className="links">
                    <a heref="#">Home</a>
                    <a heref="#">About</a>
                    <a heref="#">Project</a>
                    <a heref="#">Contact</a>
                </div>
            </div>
        </nav>
    )


}
export default Navbar;
